import React, { useRef, useEffect, useState } from 'react';
import ForceGraph2D from 'react-force-graph-2d';

const GraphVisualization = ({ data, interactive = false }) => {
  const graphRef = useRef();
  const [dimensions, setDimensions] = useState({ width: 800, height: 400 });
  const [hoverNode, setHoverNode] = useState(null);

  useEffect(() => {
    const updateDimensions = () => {
      const container = graphRef.current?.parentElement;
      if (container) {
        setDimensions({
          width: container.clientWidth,
          height: container.clientHeight
        });
      }
    };

    updateDimensions();
    window.addEventListener('resize', updateDimensions);
    return () => window.removeEventListener('resize', updateDimensions);
  }, []);

  useEffect(() => {
    if (graphRef.current && data) {
      graphRef.current.d3Force('charge').strength(-300);
      graphRef.current.d3Force('link').distance(100);
    }
  }, [data]);

  if (!data || !data.nodes || !data.links) {
    return (
      <div className="h-full w-full flex items-center justify-center">
        <div className="text-center">
          <div className="text-cyber-gray-500 text-lg mb-2">No Graph Data</div>
          <div className="text-cyber-gray-600 text-sm">Loading graph visualization...</div>
        </div>
      </div>
    );
  }

  const getNodeColor = (node) => {
    // گروه‌بندی براساس app.js
    // گروه 1: نودهای عادی (آبی)
    // گروه 2: نودهای بذر دستی (صورتی)
    // گروه 3: نودهای potential fraud (طلایی)

    if (node.group === 2) return '#ec4899'; // نئون صورتی برای بذرهای دستی
    if (node.group === 3) return '#fbbf24'; // زرد طلایی برای potential fraud
    if (node.group === 4) return '#a855f7'; // نئون بنفش (برای سایر گروه‌ها)
    return '#22d3ee'; // نئون آبی برای نودهای عادی
  };

  const getNodeSize = (node) => {
    // اندازه بر اساس PPR score
    const baseSize = 5;
    if (node.ppr > 0.01) return baseSize + (node.ppr * 150);
    if (node.ppr > 0.001) return baseSize + (node.ppr * 100);
    return baseSize;
  };

  return (
    <div className="relative h-full w-full">
      <div className="absolute inset-0 bg-gradient-to-br from-neon-cyan/5 to-neon-purple/5 rounded-lg"></div>

      {/* Tooltip برای نودها */}
      {hoverNode && (
        <div className="absolute top-4 left-4 glass-card p-3 z-10 max-w-xs">
          <div className="flex items-center space-x-2 mb-2">
            <div 
              className="w-3 h-3 rounded-full" 
              style={{ backgroundColor: getNodeColor(hoverNode) }}
            ></div>
            <p className="font-mono font-bold text-white">@{hoverNode.id}</p>
          </div>
          <div className="grid grid-cols-2 gap-2 text-xs">
            <div>
              <p className="text-cyber-gray-400">PPR Score:</p>
              <p className="text-neon-cyan font-mono">{(hoverNode.ppr || 0).toFixed(6)}</p>
            </div>
            <div>
              <p className="text-cyber-gray-400">Type:</p>
              <p className="text-white">
                {hoverNode.group === 2 ? 'Manual Seed' : 
                 hoverNode.group === 3 ? 'Potential Fraud' : 'Normal Node'}
              </p>
            </div>
          </div>
        </div>
      )}

      <ForceGraph2D
        ref={graphRef}
        graphData={data}
        nodeLabel="id"
        nodeRelSize={getNodeSize}
        nodeVal={node => (node.ppr || 0.1) * 10}
        nodeColor={node => getNodeColor(node)}
        linkColor={() => 'rgba(34, 211, 238, 0.3)'}
        linkWidth={link => Math.sqrt(link.value || 1) / 50}
        linkDirectionalParticles={1}
        linkDirectionalParticleWidth={1.5}
        linkDirectionalParticleColor={() => '#22d3ee'}
        backgroundColor="rgba(2, 6, 23, 0)"
        width={dimensions.width}
        height={dimensions.height}
        enableNodeDrag={interactive}
        enableZoomInteraction={interactive}
        enablePanInteraction={interactive}
        onNodeHover={node => setHoverNode(node)}
        onNodeClick={node => {
          console.log('Node clicked:', node);
          // باز کردن جزییات نود در آینده
        }}
        nodeCanvasObject={(node, ctx, globalScale) => {
          const label = node.id;
          const fontSize = 12/globalScale;
          ctx.font = `${fontSize}px Sans-Serif`;
          ctx.textAlign = 'center';
          ctx.textBaseline = 'middle';
          ctx.fillStyle = 'rgba(255, 255, 255, 0.8)';
          ctx.fillText(label, node.x, node.y + 10);
        }}
      />
    </div>
  );
};

export default GraphVisualization;
